import React from "react";
import '../Css/contact.css';
import { FaMapMarkerAlt,FaAt ,FaPhoneAlt,FaUserClock} from "react-icons/fa";

const Contact = () => {
    return (
      <>
      <div>
      <div className="Contact" >
           <div className="Cont_Info">
             <div><FaMapMarkerAlt/>Address City, Country</div>
             <div><FaAt/>Himanshu.shivam61@gmail.com</div>
             <div><FaPhoneAlt/>9870949800</div>
             <div><FaUserClock/>Mon-Sat 8:00 AM to 5:00 PM</div>
           </div>
        </div>
            
            <div className="Contact_form">
                <h2>Contact Us</h2>
                <form className="Con_form">
                <input type="text" name="name" className="text-box"  placeholder="Your Name"/>
                <input type="email" id="cont_form_email" placeholder="Your Email"/>
                  <input type="number" id="cont_form_phone" placeholder="Your phone" required="true"/>
                <textarea name="message" rows="5" placeholder="Your Message" required="true"></textarea>
                <button type="submit" name="submit" className="send_bt" value=""> Send</button>
                </form>

            </div>
      </div>
      
      </>
    );
  }
  
  export default Contact;
